import { ThemeProvider, Paper } from '@material-ui/core';
import { theme } from './theme';
import Banner from './components/Banner';

function App() {
  return (
    <ThemeProvider component="Paper" theme={theme}>
      {/* <Paper style={{ width: "100vw", height: "100vh" }}> */}
        <Banner />
      {/* </Paper> */}
    </ThemeProvider>
  );
}

export default App;
